class Solution:
    def findContentChildren(self, g: List[int], s: List[int]) -> int:

        def is_divisible(s):
            return sum(1 for x in s if x % 2 == 0) == 0

        # dp[i][j] -> a[i]*b[j]
        # 二分搜索，因为a[i]*b[j]中每一个数都有个搜索过程，所以搜索过程的结束条件都不再递归，所以回溯是时间复杂度O(n^2)
        def dfs(s, a, b, i):
