                return 1
            if sum(a) <= 0 or sum(b) <= 0:
                return 0
            if sum(a) == sum(b):
                return 1
            if sum(a) < sum(b):
                a[i] *= 2
                return dfs(s[1:], a, b, i + 1)
            else:
                b[i] *= 2
                return dfs(s[1:], a, b, i + 1)

        def solution(g, s):
