        placement = []
        if y > 0 and board[x][y-1] == 1:
            placement.append((x, y-1))
        if y < n and board[x][y+1] == 1:
            placement.append((x, y+1))
        if x > 0 and board[x-1][y] == 1:
            placement.append((x-1, y))
        if x < n and board[x+1][y] == 1:
            placement.append((x+1, y))
        return placement

    def bfs(x, y):
        q = [(x, y)]
        while q:
            x, y = q.pop(0)
            if x == n and y == n:
                return True
            for direct in getPlacement(x, y):
                if board[direct[0]][direct[1]] == 2:
                    board[direct[0]][direct[1]] = 0
                    q.append(direct)
                elif board[direct[0]][direct[1]] == 1:
                    board[direct[0]][direct[1]] = 0
                    q.append(direct)
        return False

