    for line in stdin.splitlines():
        # find all the characters in the word
        chars = set()
        for char in line:
            if char in characters:
                chars.add(char)
        # remove all the other chars from the word
        chars -= chars.difference(set(words))

        # if the set is empty, then there's no word
        if len(chars) == 0:
            continue

        # split the word into words
        words = set()
        for i in range(len(line) - 1):
            for c in line[i:i+2]:
                if c in characters:
                    words.add(c)

    # if there's only one word, remove it
    if len(words) == 1:
        return " ".join(words)

    # otherwise, create a new word from the words
    return " ".join(sorted(words))

