class Solution:
    def addStrings(self, num1: str, num2: str) -> str:
        n1, n2 = len(num1), len(num2)
        m, n = n1 + n2, max(n1, n2)
        l = [[0] * m for _ in range(n)]
        for i in range(n1):
            l[i][0] = int(num1[i])
        for i in range(n2):
            l[0][i + n] = int(num2[i])
        for i in range(1, n1):
            for j in range(m):
                l[i][j] = l[i - 1][j - 1] + int(num1[i])
        for i in range(1, n2):
            for j in range(m):
                l[j][m - 1 - i] = l[j - 1][m - 1 - i] + int(num2[i])
        res = [str(int(x)) for x in l[n1:]]
        return ''.join(res)

