    def solution_recursive(N: int, m: str, n: str, board: List[List[str]], m_idx: int, n_idx: int, curr_idx: int, visited: List[str]) -> str:
        if not curr_idx == N * N:
            return ""
        if curr_idx == N * N:
            return m_idx

        if board[curr_idx // N][curr_idx % N] == '#':
            return ""

        board[curr_idx // N][curr_idx % N] = '#'
        m_idx += 1

        min_steps = float('inf')

        for i in range(curr_idx, N * N):
            if i % N == n_idx:
                break
            if board[i // N][i % N] == '#':
                continue
            step = solution_recursive(N, m, n, board, m_idx, i, i + 1, visited)
            if step!= "":
                min_steps = min(min_steps, len(step))

        board[curr_idx // N][curr_idx % N] = '.'
        return str(min_steps)

    return solution_recursive(N, m, n, board, 0, 0, 0, [])

